import React from "react";
import { Workout } from ".";

export const WorkoutList = ({ workouts }) => (
  <div className="m-3 p-3 bg-gray-300 rounded">
    {workouts.map((workout, workoutIndex) => {
      return (
        <Workout
          key={`workout${workoutIndex}`}
          workout={workout}
          workoutIndex={workoutIndex}
        />
      );
    })}
  </div>
);
